import React from "react";
import "./about.css";


const About = () => (
  <div class="container-fluid">
    <h1>Get to know me</h1>
    <img src="../../../assets/Mindy-2.jpg" id="headshot" alt="Website owner headshot" />
    <p>
      I'm a mom, yoga teacher, runner, and avid video game player. I love spending time with my husband and kids, walking our tiny dog Chu,
      and I enjoy sunshine and laughing. I find coding very meditative, and I love creating. I'll always choose a relational database over a 
      non-relational one, but I won't hold it against you if you disagree with me. I'm a front-end kind of gal with plenty of experience on 
      the back-end, too. I just think the front-end is more fun. 
    </p>
  </div>
);

export default About;
